import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { CSVLink } from 'react-csv';
import Navbar from '../Navbar/Navbar';
import './StockList.css';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

const URL = "http://localhost:5000/stocks";

const fetchHandler = async () => {
  try {
    const response = await axios.get(URL);
    return response.data;
  } catch (error) {
    console.error("Error fetching stock data:", error);
    return { stocks: [] };
  }
};

function StockList({ searchQuery, setSearchQuery, onAlertCountUpdate }) {
  const [stocks, setStocks] = useState([]);
  const [lowStockItems, setLowStockItems] = useState([]);
  const navigate = useNavigate();
  const componentRef = useRef();

  useEffect(() => {
    fetchHandler().then((data) => {
      setStocks(data.stocks);
      const lowItems = data.stocks.filter(stock => stock.quantity < stock.reorderlevel);
      setLowStockItems(lowItems);

      // Send count to parent (HomeInventory)
      if (onAlertCountUpdate) {
        onAlertCountUpdate(lowItems.length);
      }
    });
  }, []);

  const filteredStocks = stocks.filter(stock =>
    stock.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  const handleDelete = async (id) => {
    try {
      await axios.delete(`${URL}/${id}`);
      const updatedStocks = stocks.filter(stock => stock._id !== id);
      setStocks(updatedStocks);
      const lowItems = updatedStocks.filter(stock => stock.quantity < stock.reorderlevel);
      setLowStockItems(lowItems);

      // Update alert count after deletion
      if (onAlertCountUpdate) {
        onAlertCountUpdate(lowItems.length);
      }

      console.log(`Deleted stock with ID: ${id}`);
    } catch (error) {
      console.error("Error deleting stock:", error);
    }
  };

  const handleUpdate = (_id) => {
    navigate(`/stock-details/${_id}`);
  };

  const handlePDFReport = () => {
    const doc = new jsPDF();
     // âœ… Replace below with your own Base64 logo
    const logoBase64 = 'data:image/png;base64,'; // <-- YOUR LOGO HERE


// shortened for clarity
doc.addImage(logoBase64, 'PNG', 15, 10, 30, 30);
  doc.setFontSize(18);
  doc.setTextColor(128, 0, 0);
  doc.text("Aroma Spices", 55, 20);
  doc.setFontSize(12);
  doc.setTextColor(0, 0, 0);
  doc.text(`Date: ${new Date().toLocaleDateString()}`, 55, 28);

  doc.setFontSize(16);
  doc.setTextColor(128, 0, 0);
  doc.text("Spice Stock Report", 70, 45);

const tableColumn = ["Name", "Category", "Quantity (Kg)", "Reorder Level", "Supplier", "Date Added"];
const tableRows = [];

filteredStocks.forEach(stock => {
  tableRows.push([
    stock.name || "N/A",
    stock.category || "N/A",
    stock.quantity || 0,
    stock.reorderlevel || 0,
    stock.supplier || "N/A",
    new Date(stock.dateAdded).toLocaleDateString()
  ]);
});

autoTable(doc, {
  head: [tableColumn],
  body: tableRows,
  startY: 55,
  styles: {
    fontSize: 10,
    cellPadding: 3,
  },
  headStyles: {
    fillColor: [128, 0, 0],
    textColor: [255, 255, 255],
  },
  alternateRowStyles: { fillColor: [245, 235, 220] },
});

// Footer with contact details
const pageHeight = doc.internal.pageSize.height;
doc.setFontSize(10);
doc.setTextColor(0, 0, 0);
doc.setDrawColor(200, 0, 0);
doc.line(10, pageHeight - 25, 200, pageHeight - 25);

doc.text("Address: 123 Spice Avenue, Colombo, Sri Lanka", 10, pageHeight - 20);
doc.text("Contact: +94 77 123 4567 | Email: info@aromaspices.com", 10, pageHeight - 15);
doc.text("Socials: fb.com/aromaspices | x.com/aromaspices | instagram.com/aromaspices", 10, pageHeight - 10);

doc.save("Spice_Stock_Report.pdf");
};

  const handleAlertNavigation = () => {
    localStorage.setItem("lowStockItems", JSON.stringify(lowStockItems));
    navigate('/alert');
  };

  return (
    <div>
      <Navbar setSearchQuery={setSearchQuery} />
      <h1 className="title">Stock Details Display</h1>

      <CSVLink
        data={filteredStocks.map(stock => ({
          name: stock.name || "N/A",
          category: stock.category || "N/A",
          quantity: stock.quantity || 0,
          reorderlevel: stock.reorderlevel || 0,
          supplier: stock.supplier || "N/A",
          dateAdded: new Date(stock.dateAdded).toLocaleDateString()
        }))}
        headers={[
          { label: "Name", key: "name" },
          { label: "Category", key: "category" },
          { label: "Quantity (Kg)", key: "quantity" },
          { label: "Reorder Level (Kg)", key: "reorderlevel" },
          { label: "Supplier", key: "supplier" },
          { label: "Date Added", key: "dateAdded" },
        ]}
        filename={"stock_list_report.csv"}
      >
        <button className="report-btn1">Download CSV Report</button>
      </CSVLink>

      <br />

      <button className="report-btn" onClick={handlePDFReport}>
        Download PDF Report
      </button>

      <button className="alert-btn" onClick={handleAlertNavigation}>
        Go to Alerts {lowStockItems.length > 0 && <span className="alert-badge">{lowStockItems.length}</span>}
      </button>

      <div className="table-container" ref={componentRef}>
        {filteredStocks.length > 0 ? (
          <table className="stock-table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Category</th>
                <th>Quantity (Kg)</th>
                <th>Reorder Level (Kg)</th>
                <th>Supplier</th>
                <th>Date Added</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {filteredStocks.map((stock) => (
                <tr key={stock._id}>
                  <td>{stock.name || "N/A"}</td>
                  <td>{stock.category || "N/A"}</td>
                  <td>{stock.quantity || 0}</td>
                  <td>{stock.reorderlevel || 0}</td>
                  <td>{stock.supplier || "N/A"}</td>
                  <td>{new Date(stock.dateAdded).toLocaleDateString()}</td>
                  <td>
                    <button className="update-btn" onClick={() => handleUpdate(stock._id)}>Update</button>
                    <button className="delete-btn" onClick={() => handleDelete(stock._id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <h3 className="no-data">No products found</h3>
        )}
      </div>
    </div>
  );
}

export default StockList;
